private static SingleTon singleton;
/**
* 构造方法特征方法名和类名相同且无返回值.
* 因为它必须返回当前对象的引用；
* 单例设计模式首先要求其构造方法的私有化，这样其他类不能实例化这
个类对象，同时需要对外提供提供入口
*/
private SingleTon(){}
/**
* 实例方法,实例方法必须通过对象调用
*
* 设置方法为静态方法，才能调用
* @return
*/

public static SingleTon getInstance(){
//添加逻辑如果实例化过,直接返回
if(singleton==null){
/*
* 多线程访问下,可能出现if 同时成立的情况（同时
执行到if语句）,需要添加锁*/
synchronized (SingleTon.class) {
//双重验证
if(singleton==null){
singleton = new SingleTon();
}
}
}
return singleton;
}
}

